INSERT INTO `Countries` (`ISO`, `ISONumeric`, `CountryName`, `Capital`, `GeoNameID`, `Area`, `Population`, `Continent`, `TopLevelDomain`, `CurrencyCode`, `CurrencyName`, `PhoneCountryCode`, `Languages`, `Neighbours`, `CountryDescription`) VALUES ('AD', '020', 'Andorra', 'Andorra la Vella', 3041565, '468', 84000, 'EU', '.ad', 'EUR', 'Euro', '376', 'ca', 'ES,FR', 'Andorra is a landlocked microstate in Southwestern Europe, located in the eastern Pyrenees mountains and bordered by Spain and France. Its capital, Andorra la Vella, is the highest capital city in Europe, at an elevation of 1,023 metres (3,356 ft) above sea level. The official language is Catalan, although Spanish, Portuguese, and French are also commonly spoken.');
INSERT INTO `Countries` (`ISO`, `ISONumeric`, `CountryName`, `Capital`, `GeoNameID`, `Area`, `Population`, `Continent`, `TopLevelDomain`, `CurrencyCode`, `CurrencyName`, `PhoneCountryCode`, `Languages`, `Neighbours`, `CountryDescription`) VALUES ('AE', '784', 'United Arab Emirates', 'Abu Dhabi', 290557, '82880', 4975593, 'AS', '.ae', 'AED', 'Dirham', '971', 'ar-AE,fa,en,hi,ur', 'SA,OM', 'The United Arab Emirates is an Arab country in the southeast of the Arabian Peninsula on the Persian Gulf, bordering Oman to the east and Saudi Arabia to the south, as well as sharing sea borders with Qatar and Iran. The UAE is a federation of seven emirates (equivalent to principalities), each governed by a hereditary emir, with a single national president. The constituent emirates are Abu Dhabi, Ajman, Dubai, Fujairah, Ras al-Khaimah, Sharjah, and Umm al-Quwain. The capital is Abu Dhabi, which is also the state\'s center of political, industrial, and cultural activities.');
