INSERT INTO `Countries` (`ISO`, `ISONumeric`, `CountryName`, `Capital`, `GeoNameID`, `Area`, `Population`, `Continent`, `TopLevelDomain`, `CurrencyCode`, `CurrencyName`, `PhoneCountryCode`, `Languages`, `Neighbours`, `CountryDescription`) VALUES ('IS', '352', 'Iceland', 'Reykjavik', 2629691, '103000', 308910, 'EU', '.is', 'ISK', 'Krona', '354', 'is,en,de,da,sv,no', NULL, 'The Republic of Iceland is a Nordic island country in the North Atlantic Ocean. It has a population of 332,529 and an area of 103,000 km2 (40,000 sq mi), making it the most sparsely populated country in Europe. The capital and largest city is Reykjavík. Reykjavík and the surrounding areas in the southwest of the country are home to over two-thirds of the population. Iceland is volcanically and geologically active. The interior consists of a plateau characterised by sand and lava fields, mountains and glaciers, while many glacial rivers flow to the sea through the lowlands. Iceland is warmed by the Gulf Stream and has a temperate climate, despite a high latitude just outside the Arctic Circle. Its high latitude and marine influence still keeps summers chilly, with most of the archipelago having a tundra climate.');
INSERT INTO `Countries` (`ISO`, `ISONumeric`, `CountryName`, `Capital`, `GeoNameID`, `Area`, `Population`, `Continent`, `TopLevelDomain`, `CurrencyCode`, `CurrencyName`, `PhoneCountryCode`, `Languages`, `Neighbours`, `CountryDescription`) VALUES ('IT', '380', 'Italy', 'Rome', 3175395, '301230', 60340328, 'EU', '.it', 'EUR', 'Euro', '39', 'it-IT,de-IT,fr-IT,sc,ca,co,sl', 'CH,VA,SI,SM,FR,AT', 'Italy is a unitary parliamentary republic in Southern Europe. To the north, it borders France, Switzerland, Austria, and Slovenia along the Alps. To the south, it consists of the entirety of the Italian Peninsula, Sicily, Sardinia–the two largest islands in the Mediterranean Sea–and many other smaller islands. The independent states of San Marino and the Vatican City are enclaves within Italy, while Campione d\'Italia is an Italian exclave in Switzerland. The territory of Italy covers some 301,338 km2 (116,347 sq mi) and is influenced by a temperate seasonal climate. With 60.8 million inhabitants, it is the fifth most populous country in Europe, and the 23rd most populous in the world.');
