INSERT INTO `Countries` (`ISO`, `ISONumeric`, `CountryName`, `Capital`, `GeoNameID`, `Area`, `Population`, `Continent`, `TopLevelDomain`, `CurrencyCode`, `CurrencyName`, `PhoneCountryCode`, `Languages`, `Neighbours`, `CountryDescription`) VALUES ('US', '840', 'United States', 'Washington', 6252001, '9629091', 310232863, 'NA', '.us', 'USD', 'Dollar', '1', 'en-US,es-US,haw,fr', 'CA,MX,CU', 'The United States of America (commonly called the United States, the U.S., the USA, America, and the States) is a federal constitutional republic consisting of fifty states and a federal district. The country is situated mostly in central North America, where its forty-eight contiguous states and Washington, D.C., the capital district, lie between the Pacific and Atlantic Oceans, bordered by Canada to the north and Mexico to the south. The state of Alaska is in the northwest of the continent, with Canada to the east and Russia to the west across the Bering Strait. The state of Hawaii is an archipelago in the mid-Pacific. The country also possesses several territories in the Pacific and Caribbean. At 3.79 million square miles (9.83 million km2) and with over 314 million people, the United States is the third- or fourth-largest country by total area, and the third-largest by both land area and population. It is one of the world\'s most ethnically diverse and multicultural nations, the product of large-scale immigration from many countries.');
INSERT INTO `Countries` (`ISO`, `ISONumeric`, `CountryName`, `Capital`, `GeoNameID`, `Area`, `Population`, `Continent`, `TopLevelDomain`, `CurrencyCode`, `CurrencyName`, `PhoneCountryCode`, `Languages`, `Neighbours`, `CountryDescription`) VALUES ('UY', '858', 'Uruguay', 'Montevideo', 3439705, '176220', 3477000, 'SA', '.uy', 'UYU', 'Peso', '598', 'es-UY', 'BR,AR', 'Uruguay is a country in the southeastern part of South America. It is home to 3.3 million people, of whom 1.8 million live in the capital Montevideo and its metropolitan area. An estimated 88% of the population is of European descent. With an area of approximately 176,000 square kilometres (68,000 sq mi), Uruguay is the second-smallest nation in South America by area, after Suriname.');
