INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (1, 2, 3, 'Calgary in the Snow', 'In December of 2011, I was lucky/unfortunate enough to have the opportunity to fly to chilly Calgary in Western Canada for a week-long conference. I was all prepared for winter and cold … it was to Canada after all that I was travelling! Imagine my surprise when I arrived at the airport on Saturday morning to find the temperature was over 10 degrees Celsius. Yet within just a few hours, the weather began to turn. On Sunday morning, I awoke at 6am local time to find that the city was dusted in about 10cm of snow. <p>It was truly magical! A hush had descended upon the city to go with the snow. And yet, again, to my surprise, there were joggers out at 7am running, snow or no snow. None the less, I spent almost two hours walking all across the center of the city, snapping photos, glad that I had packed mittens and a hat.', '2011-12-04 00:00:00');
INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (2, 1, 1, 'Fall Colors in Calgary', 'As part of John and I\'s journey across Canada, we found ourselves finally leaving the prairies and heading to Calgary, one of Canada\'s major cities, which lies less than an hour\'s drive from the mountains.<p>The weather was tremendous. Fall colors had blanketing the city, though there still was plenty of green. Perhaps my favorite photo location was Edworthy Park in Calgary. This park is on the western edge of the city right beside the Bow River. The park is also bordered by hills that contain what are amounts to old-growth forests.<p>Evidently the park used to be part of a ranch with cows and horses. While we didn\'t see any domestic animals, there were a variety of wonderful trails meandering through the hills, from which I snapped these photos.', '2011-10-08 00:00:00');
INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (3, 5, 5, 'Mountain Climbing', 'The highlight of our last trip to Canada was a climb up Sulpher Mountain just outside of Banff. I\'d like to say that it was so difficult that we required crampons, pitons, and screamers … but that would be stretching the truth for sure.<p>The ascent up Sulpher Mountain in fact can be made via a gondola. We decided to walk instead, which took us just about 90 minutes, if I remember correctly. There were lots of other people making the same ascent. Most of the climb is a series of eventually tedious switchbacks. Yet the view eventually becomes quite stunning, allowing one to view up and down the Bow River valley.', '2011-09-03 00:00:00');
