INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (9, 13, 8, 'Nova Scotia', '<p>The steamer Mongolia, belonging to the Peninsular and Oriental Company, built of iron, of two thousand eight hundred tons burden, and five hundred horse-power, was due at eleven o\'clock a.m. on Wednesday, the 9th of October, at Suez.  The Mongolia plied regularly between Brindisi and Bombay via the Suez Canal, and was one of the fastest steamers belonging to the company, always making more than ten knots an hour between Brindisi and Suez, and nine and a half between Suez and Bombay.</p>\n\n<p>Two men were promenading up and down the wharves, among the crowd of natives and strangers who were sojourning at this once straggling village&mdash;now, thanks to the enterprise of M. Lesseps, a fast-growing town.  One was the British consul at Suez, who, despite the prophecies of the English Government, and the unfavourable predictions of Stephenson, was in the habit of seeing, from his office window, English ships daily passing to and fro on the great canal, by which the old roundabout route from England to India by the Cape of Good Hope was abridged by at least a half.  The other was a small, slight-built personage, with a nervous, intelligent face, and bright eyes peering out from under eyebrows which he was incessantly twitching.  He was just now manifesting unmistakable signs of impatience, nervously pacing up and down, and unable to stand still for a moment.  This was Fix, one of the detectives who had been dispatched from England in search of the bank robber; it was his task to narrowly watch every passenger who arrived at Suez, and to follow up all who seemed to be suspicious characters, or bore a resemblance to the description of the criminal, which he had received two days before from the police headquarters at London.  The detective was evidently inspired by the hope of obtaining the splendid reward which would be the prize of success, and awaited with a feverish impatience, easy to understand, the arrival of the steamer Mongolia.</p>\n\n<p>\"So you say, consul,\" asked he for the twentieth time, \"that this steamer is never behind time?\"</p>\n\n<p>\"No, Mr. Fix,\" replied the consul.  \"She was bespoken yesterday at Port Said, and the rest of the way is of no account to such a craft.  I repeat that the Mongolia has been in advance of the time required by the company\'s regulations, and gained the prize awarded for excess of speed.\"</p>\n\n<p>\"Does she come directly from Brindisi?\"</p>', '2012-03-19 00:00:00');
INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (10, 18, 22, 'Rio Reno Voyage', '<p>Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular. Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules.</p>\n\n<p>Omnicos directe al desirabilite de un nov lingua franca: On refusa continuar payar custosi traductores. At solmen va esser necessi far uniform grammatica, pronunciation e plu sommun paroles.</p>\n\n<p>Ma quande lingues coalesce, li grammatica del resultant lingue es plu simplic e regulari quam ti del coalescent lingues. Li nov lingua franca va esser plu simplic e regulari quam li existent Europan lingues. It va esser tam simplic quam Occidental in fact, it va esser Occidental.</p>\n\n<p>A un Angleso it va semblar un simplificat Angles, quam un skeptic Cambridge amico dit me que Occidental es. Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular. Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules. Omnicos directe al desirabilite de un nov lingua franca: On refusa continuar payar custosi traductores. At solmen va esser necessi far uniform grammatica, pronunciation e plu sommun paroles.</p>', '2012-11-23 00:00:00');
INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (11, 20, 24, 'European Business', '<p>At last we gained such an offing, that the two pilots were needed no longer. The stout sail-boat that had accompanied us began ranging alongside.</p>\n\n<p>It was curious and not unpleasing, how Peleg and Bildad were affected at this juncture, especially Captain Bildad. For loath to depart, yet; very loath to leave, for good, a ship bound on so long and perilous a voyage&mdash;beyond both stormy Capes; a ship in which some thousands of his hard earned dollars were invested; a ship, in which an old shipmate sailed as captain; a man almost as old as he, once more starting to encounter all the terrors of the pitiless jaw; loath to say good-bye to a thing so every way brimful of every interest to him,&mdash;poor old Bildad lingered long; paced the deck with anxious strides; ran down into the cabin to speak another farewell word there; again came on deck, and looked to windward; looked towards the wide and endless waters, only bounded by the far-off unseen Eastern Continents; looked towards the land; looked aloft; looked right and left; looked everywhere and nowhere; and at last, mechanically coiling a rope upon its pin, convulsively grasped stout Peleg by the hand, and holding up a lantern, for a moment stood gazing heroically in his face, as much as to say, \"Nevertheless, friend Peleg, I can stand it; yes, I can.\"</p>\n\n<p>As for Peleg himself, he took it more like a philosopher; but for all his philosophy, there was a tear twinkling in his eye, when the lantern came too near. And he, too, did not a little run from cabin to deck&mdash;now a word below, and now a word with Starbuck, the chief mate.</p>\n\n<p>But, at last, he turned to his comrade, with a final sort of look about him,&mdash;\"Captain Bildad&mdash;come, old shipmate, we must go. Back the main-yard there! Boat ahoy! Stand by to come close alongside, now! Careful, careful!&mdash;come, Bildad, boy&mdash;say your last. Luck to ye, Starbuck&mdash;luck to ye, Mr. Stubb&mdash;luck to ye, Mr. Flask&mdash;good-bye and good luck to ye all&mdash;and this day three years I\'ll have a hot supper smoking for ye in old Nantucket. Hurrah and away!\"</p>', '2012-08-20 00:00:00');
INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (12, 27, 7, 'Honeymoon Journey', '<p>Far far away, behind the word mountains, far from the countries Vokalia and Consonantia, there live the blind texts. Separated they live in Bookmarksgrove right at the coast of the Semantics, a large language ocean.</p>\n\n<p>A small river named Duden flows by their place and supplies it with the necessary regelialia. It is a paradisematic country, in which roasted parts of sentences fly into your mouth.</p>\n\n<p>Even the all-powerful Pointing has no control about the blind texts it is an almost unorthographic life One day however a small line of blind text by the name of Lorem Ipsum decided to leave for the far World of Grammar.</p>\n\n<p>The Big Oxmox advised her not to do so, because there were thousands of bad Commas, wild Question Marks and devious Semikoli, but the Little Blind Text didn’t listen. She packed her seven versalia, put her initial into the belt and made herself on the way. When she reached the first hills of the Italic Mountains, she had a last view back on the skyline of her hometown Bookmarksgrove, the headline of Alphabet Village and the subline of her own road, the Line Lane. Pityful a rethoric question ran over her cheek, then</p>', '2011-08-22 00:00:00');
