INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (29, 12, 76, 'Greek Dreaming', '<p>Soon we were running through a suffusing wide veil of mist; neither ship nor boat to be seen.</p>\n\n<p>\"Give way, men,\" whispered Starbuck, drawing still further aft the sheet of his sail; \"there is time to kill a fish yet before the squall comes. There\'s white water again!&mdash;close to! Spring!\"</p>\n\n<p>Soon after, two cries in quick succession on each side of us denoted that the other boats had got fast; but hardly were they overheard, when with a lightning-like hurtling whisper Starbuck said: \"Stand up!\" and Queequeg, harpoon in hand, sprang to his feet.</p>', '2013-04-30 00:00:00');
INSERT INTO `Posts` (`PostID`, `UID`, `MainPostImage`, `Title`, `Message`, `PostTime`) VALUES (30, 21, 81, 'Oxford Day Trip', '<p>Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular. Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules.</p>\n\n<p>Omnicos directe al desirabilite de un nov lingua franca: On refusa continuar payar custosi traductores. At solmen va esser necessi far uniform grammatica, pronunciation e plu sommun paroles.</p>\n\n<p>Ma quande lingues coalesce, li grammatica del resultant lingue es plu simplic e regulari quam ti del coalescent lingues. Li nov lingua franca va esser plu simplic e regulari quam li existent Europan lingues. It va esser tam simplic quam Occidental in fact, it va esser Occidental.</p>\n\n<p>A un Angleso it va semblar un simplificat Angles, quam un skeptic Cambridge amico dit me que Occidental es. Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular. Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules. Omnicos directe al desirabilite de un nov lingua franca: On refusa continuar payar custosi traductores. At solmen va esser necessi far uniform grammatica, pronunciation e plu sommun paroles.</p>', '2013-03-22 00:00:00');
